INSERT INTO `Brand`(brandIdx, bankAccountNumber, brandImage, brandIntroduction, brandName, brandStyle, businessAddress, businessRegistration, createdAt, phoneNumber, returnAddress, returnCost, returnCourier, status, updatedAt, brandUniqueKey) VALUES (1,'111-111111-111','https://lonua-brand.s3.ap-northeast-2.amazonaws.com/2024/01/14/a7b76261-e85d-4773-ae78-927e93cf7e8f_spao.png','스파오는 좋은 소재와 기본에 충실하면서도 트렌디한 디자인으로 남녀노소 누구나 일상 속에서 편안하게 입을 수 있는 패션 라이프를 제안하는 국내 최초 글로벌 SPA 브랜드입니다.','SPAO','스포츠','서울특별시 금천구 가산디지털1로 159 (가산동) 이랜드 가산동 사옥','1138519030','2024/01/14 14:05:03','1670-9700','(31214) 충청남도 천안시 동남구 풍세산단3로 111 이랜드패션통합물류센터 4F 스파오',6000,'CJ대한통운',_binary '','2024/01/14 14:05:03','qmfosem1'),(2,'222-222222-222','https://lonua-brand.s3.ap-northeast-2.amazonaws.com/2024/01/14/0b669672-5634-402d-9541-71bab8f6df16_YALE.jpeg','예일(YALE)은 1900년대부터 아이비리그 스포츠를 대표하는 미국의 명문대학교입니다. 예일 대학교와 예일 불독스(예일의 대표 스포츠팀)는 스포츠 브랜드와 스폰서십을 체결하며, 스포츠 웨어와 빈티지 웨어로써도 널리 알려져 있습니다.','YALE','캐주얼','서울특별시 성동구 성수일로12가길 22 전층(성수동2가)','1888101953','2024/01/14 14:11:18','070-7424-9393','(17314) 경기 이천시 백사면 내촌리 235-1 지상 4층 DPL 센터',6000,'CJ대한통운',_binary '','2024/01/14 14:11:18','qmfosem2'),(3,'333-333333-333','https://lonua-brand.s3.ap-northeast-2.amazonaws.com/2024/01/14/29f7a9a7-257d-4432-9161-cb6240e24255_COVERNAT.jpg','커버낫(COVERNAT)은 밀리터리, 아웃도어, 워크웨어 등의 빈티지웨어에서 얻은 모티브를 현대적인 소재와 룩으로 푸는 컨템퍼러리 브랜드입니다. 2008년에 데뷔한 이래 지금도 매 시즌 과거로부터 얻은 영감을 커버낫만의 시각으로 재해석해 도심 속에서 사는 사람들의 다양한 스타일을 풀 컬렉션으로 소개합니다.','COVERNAT','스트릿','서울특별시 마포구 잔다리로 20-5 3층, 4층, 5층','2618117293','2024/01/14 14:15:58','02-338-3316','(17161) 경기 용인시 처인구 양지면 양지리 920 양지 LOGISCO 물류센터 4층 비케이브물류',6000,'롯데택배',_binary '','2024/01/14 14:15:58','qmfosem3'),(4,'444-444444-444','https://lonua-brand.s3.ap-northeast-2.amazonaws.com/2024/01/14/4f62cdcb-328c-476e-b445-d68e1d3be54f_INSILENCE.png','인사일런스(INSILENCE)는 동시대의 분위기를 반영한 어패럴 라인을 출시하는 것에 집중하며, 독자적인 실루엣과 현대적인 감성으로 아이템을 재해석한 고감도 제품을 선보입니다.','INSILENCE','스트릿','서울특별시 성동구 상원1길 26 15층 1501호,1505호 인사일런스(성수동 1가, 서울숲A타워)','